(10678, 5900, 4, 'Aug 20, 2015 at Thu 08:49am\n - Whatclinic lead. He had consultation last July 2015. Q: 3000 grafts at 288,000 pesos. He went to Maxim and was quoted a lower package. He was disappointed on how Maxims clinic looks and opted to check other clinics. Lead is scheduled to have his SS July but he said he doesnt have time anymore due to his trip to Bicol.\n\nHe sms from Canada asking for lower quotation.\n\nFinal quote (sent via email): \n\nWe charge 120 pesos per graft for FUE and during the time you went to our clinic we were giving 20% discount. The best price I could give is 80 pesos per graft. 2,500 - 3,000 grafts is at 200,000 - 240,000 pesos.\n\nFor FUE patients, I highly recommend to do Platelet Rich Plasma (PRP). I discussed the procedure and purpose of it last time you had consultation. The healing is faster and it promotes better growth. Its additional of 10,000 pesos. \n\n\n\n\n', '0000-00-00 00:00:00'),
(10679, 5900, 4, 'Whatclinic lead. He had consultation last July 2015. Q: 3000 grafts at 288,000 pesos. He went to Maxim and was quoted a lower package. He was disappointed on how Maxims clinic looks and opted to check other clinics. Lead is scheduled to have his SS July but he said he doesnt have time anymore due to his trip to Bicol.\n\nHe sms from Canada asking for lower quotation.\n\nFinal quote (sent via email): \n\nWe charge 120 pesos per graft for FUE and during the time you went to our clinic we were giving 20% discount. The best price I could give is 80 pesos per graft. 2,500 - 3,000 grafts is at 200,000 - 240,000 pesos.\n\nFor FUE patients, I highly recommend to do Platelet Rich Plasma (PRP). I discussed the procedure and purpose of it last time you had consultation. The healing is faster and it promotes better growth. Its additional of 10,000 pesos. \n\n', '0000-00-00 00:00:00'),
