(11207, 6191, 2, 'Oct 05, 2015 at Mon 07:51pm\n - KTG - FUT / Strip is the traditional method. We get strip of skin at the back of the head and dissect it one by one into 1500-2000 grafts. It is usually done 5-6 hours. You will have a stitch line on the donor area. It will not be seen if your hair is half an inch long or longer. Heres the quotation:\n \n1500 - 2000 grafts x 60 = 90,000 - 120,000 pesos\n\nFUE / Neografting also known as no scar method. We get the grafts one by one using a device. It is usually done 8-12 hours. This procedure will not leave you a linear scar on the donor area but we have to shave the entire head or at least the back and sides.The healing is faster compared to FUT. Heres the quotation:\n \n1500 - 2000 grafts x 80 = 120,000 - 160,000 pesos\n \nPlease note: \n \n*The package is inclusive of take home medication and lifetime check up.\n \nIf your going to pay in cash, I can give you additional 10,000 pesos discount in any of the procedure.\n\n\nOct 05, 2015 at Mon 07:36pm\n - KTG - Called lead last week. Old inquiry. As per discussion he will send me photos of himself. He sent photos today. Hairline. Q: at least 1500 grafts x 80 pesos FUE = 120k. \n\n\nOct 01, 2015 at Thu 10:47am\n - JTG - sent email for consultation\n\n\n', '0000-00-00 00:00:00'),
(11208, 6191, 2, 'KTG - FUT / Strip is the traditional method. We get strip of skin at the back of the head and dissect it one by one into 1500-2000 grafts. It is usually done 5-6 hours. You will have a stitch line on the donor area. It will not be seen if your hair is half an inch long or longer. Heres the quotation:\n \n1500 - 2000 grafts x 60 = 90,000 - 120,000 pesos\n\nFUE / Neografting also known as no scar method. We get the grafts one by one using a device. It is usually done 8-12 hours. This procedure will not leave you a linear scar on the donor area but we have to shave the entire head or at least the back and sides.The healing is faster compared to FUT. Heres the quotation:\n \n1500 - 2000 grafts x 80 = 120,000 - 160,000 pesos\n \nPlease note: \n \n*The package is inclusive of take home medication and lifetime check up.\n \nIf your going to pay in cash, I can give you additional 10,000 pesos discount in any of the procedure.', '0000-00-00 00:00:00'),
