(11287, 6237, 5, 'JTG - RVB already sent an email.\n\nDear Nestor, \nThank you very much for your query. You see, hair restoration surgery is the only real and permanent solution to hair loss. I would be very happy to help you. So that I can be more precise on what is really best for you, it would help a lot if you could send me pictures of your head (front, left and right side, and back view)so I could ascertain the number of grafts you would need and also gauge the feasibility of your donor site. It would be best, of course, if you can see me for a personal consultation. I guarantee complete confidentiality. It is our aim to give you the best service at the least cost (guaranteed lowest price in the market). Looking forward to hearing from you soon; I welcome all your queries. Thanks and best regards.\n', '0000-00-00 00:00:00'),
