(12784, 7086, 4, 'KTG- Kathleen Guerrero\n10:38 AM (4 hours ago)\n\nto miahharun772, Rehn, me \nHi Harun,\n \nThank you for inquiring with Nu/Hart Hair Restoration Philippines. I am Kathleen Guerrero, Clinic Manager of Manila branch.\n \nWe specialize on hair transplantation, a minor surgical procedure. It is the best solution for hair loss. The result is permanent and natural.\n \nRegarding your inquiry, we charge 120 pesos per graft for FUE. We are giving 20% discount until May 31, 2016.\n \nFor assessment, please send photos of yourself (front,top,back and sides of the head) to kat@nuhartclinic.com.ph or via Viber/Whatsapp +639178742828.\n \nWhen are you planning to go to Manila?\n  \nI am looking forward to speaking with you soon!\n \nThank you.\n \nBest regards,\n\nKathleen Guerrero\nClinic Manager\nUnit 301 State Condominium 1,186 Salcedo St.,\nLegaspi Village, Makati City 1229\nMobile No.: +63.917.874.2828\nTel. No.: +63.2.818.8008 or +63.2.519.6615', '0000-00-00 00:00:00'),
