(13105, 7253, 3, 'Jul 07, 2016 at Thu 03:39pm\n - KTG June 4: Ok the 60 or 80,000 will cover how many FUT or FUE? 80,000 - 64,000 (PROMO RATE) IS OUR MINIMUM PACKAGE FOR FUT 1000 GRAFTS.\n\nand what about the follow up\nI travel outside the country on a regular basis. I need to find out the maintenance, restrictions and scheduled visit post surgery?  Is there any guarantee on the treatment? \n\nWE NEED A DAY TO DO THE PROCEDURE AND FOR POST CARE WE ASK OUR PATIENTS TO COME BACK AFTER TWO DAYS FOR CHECK UP. THIS IS NOT A MUST BUT IF YOUR JUST IN MANILA ITS BEST TO HAVE CLINIC CHECK UP. FOR OUR PATIENTS WHO CANNOT STAY WE DO VIDEO CALL TO CHECK ON THEM(SKYPE). IF YOU WILL HAVE FUT WE NEED TO REMOVE THE SUTURE WITHIN 10-14 DAYS. FOR FUE NO NEED FOR THAT BECASUE YOU DONT HAVE ANY STITCH LINE. yOU CAN TRAVEL 2 A DAY AFTER YOUR PROCEDURE (BY LAND AND PLANE). NO WORKOUT FOR 10-14 DAYS.\n\nI am out of the country now and wont be back till the 28th\nYou can book me on that day around mid afternoon\n\nI WILL BOOK YOUR A FREE CONSULTATION ON JUNE 28 MID AFTERNOON.\n\nFOR PRE ASSESSMENT KINDLY SEND ME PHOTOS OF YOURSELF FRONT,TOP,BACK AND SIDES OF THE HEAD SO I COULD IVE YOU AN ESTIMATE.\n\nTHANK YOU.\n\nREGARDS,\n\nKATHLEEN\n\n\nJul 07, 2016 at Thu 03:37pm\n - KTG - He sent photo July 10: As per photos your problem area is the top portion. You need at least 1000 grafst for that. I cant see the hairline on the photos. If ever your hairline is receding we need to add more grafts.\n\nSee you on June 28 for consultation.\n\nRegards,\n\nKathleen\n\n\nJul 07, 2016 at Thu 03:36pm\n - KTG - SC no show. Followed up via email no reply. Number cannot be reach. For follow up.\n\n\n', '0000-00-00 00:00:00'),
(13106, 7253, 3, 'KTG June 4: Ok the 60 or 80,000 will cover how many FUT or FUE? 80,000 - 64,000 (PROMO RATE) IS OUR MINIMUM PACKAGE FOR FUT 1000 GRAFTS.\n\nand what about the follow up\nI travel outside the country on a regular basis. I need to find out the maintenance, restrictions and scheduled visit post surgery?  Is there any guarantee on the treatment? \n\nWE NEED A DAY TO DO THE PROCEDURE AND FOR POST CARE WE ASK OUR PATIENTS TO COME BACK AFTER TWO DAYS FOR CHECK UP. THIS IS NOT A MUST BUT IF YOUR JUST IN MANILA ITS BEST TO HAVE CLINIC CHECK UP. FOR OUR PATIENTS WHO CANNOT STAY WE DO VIDEO CALL TO CHECK ON THEM(SKYPE). IF YOU WILL HAVE FUT WE NEED TO REMOVE THE SUTURE WITHIN 10-14 DAYS. FOR FUE NO NEED FOR THAT BECASUE YOU DONT HAVE ANY STITCH LINE. yOU CAN TRAVEL 2 A DAY AFTER YOUR PROCEDURE (BY LAND AND PLANE). NO WORKOUT FOR 10-14 DAYS.\n\nI am out of the country now and wont be back till the 28th\nYou can book me on that day around mid afternoon\n\nI WILL BOOK YOUR A FREE CONSULTATION ON JUNE 28 MID AFTERNOON.\n\nFOR PRE ASSESSMENT KINDLY SEND ME PHOTOS OF YOURSELF FRONT,TOP,BACK AND SIDES OF THE HEAD SO I COULD IVE YOU AN ESTIMATE.\n\nTHANK YOU.\n\nREGARDS,\n\nKATHLEEN', '0000-00-00 00:00:00'),
